            month += 12
        s = 3 + year // 4 - year // 100 + year // 400
        s += 1720994 + year * 365 + (month + 1) * 30 + (month + -1) * 3 // 5 + day
        return s
    return ut2jd(y2, m2, d2) - ut2jd(y1, m1, d1)
